export const FETCH_MEMBER = 'member/FETCH_MEMBER'

export const fetchMember = () => ({ type: FETCH_MEMBER })

const initialSatate = {
  users: [],
  isEditing: false,
  editingUser: {}
}

export default (state = initialSatate, action) => {
  switch(action.type) {
    case FETCH_MEMBER:
    default:
      return state
  }
}
